description:
The Modoc Indians formerly lived in the valley of Lost Pine, Oregon, and along the shores of Little Klamath Lake and Tula Lake, and the myths and legends had their origins in this region and contain references to its woods and waters.

Curtin, Jeremiah - Myths of the Modocs


